import React from "react";
import { useRef, useState } from "react";
import "./css/log.css";
import { useNavigate } from "react-router";
function Log() {
  const usr = useRef(null);
  const pass = useRef(null);
  const [lm, setlm] = useState(false);
  const navigate = useNavigate();
  const submit = () => {
    setlm(true);
  };
  const siup =()=>{
    navigate("/signup");
  }
  return (
    <div className="login">
      <form action="POST" onSubmit={submit}>
        <h1 className="tit">login</h1>
        <br />
        <label htmlFor="una">username</label>
        <br />
        <div>
          <span className="una"></span>
          <input ref={usr} id="una" placeholder="username.." required />
          <br />
        </div>
        <br />
        <label htmlFor="una">password</label>
        <br />
        <div>
          <span className="pass"></span>
          <input ref={pass} id="pass" placeholder="password.." required />
          <br />
        </div>
        <div className="fogpass">
          <button>forgot password?</button>
        </div>
        <button type="submit" className="sr">submit</button>
        <button type="reset" className="sr">reset</button>
        <br />
        <button className="sup" onClick={siup}>SIGN UP</button>
      </form>
    </div>
  );
}
export default Log;
